// Styles files 
import '../styles/index.scss';
import MiddleLeft from '../components/svg/middle_left';

// -----------------------------------------------------
export default () => (
  <div>
    <TopRight/>
    <Head title="Acceuil | Company name"/>
    <Header/>
    <Body_section1/>
    <MiddleLeft/>
  </div>
);
